css:
.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #dccd69 0%, rgba(220, 205, 105, 0.30000000000000004) 20%, rgba(220, 205, 105, 0.30000000000000004) 80%, #dccd69 100%);
  border-left: 2px solid #dccd69;
  border-right: 2px solid #dccd69;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #ce4045 0%, rgba(206, 64, 69, 0.30000000000000004) 20%, rgba(206, 64, 69, 0.30000000000000004) 80%, #ce4045 100%);
  border-left: 2px solid #ce4045;
  border-right: 2px solid #ce4045;
}
